pragma solidity ^0.4.4;


import 'zeppelin-solidity/contracts/token/StandardToken.sol';
import './IssuableToken.sol';
import './SeizableToken.sol';
import './ChargeableToken.sol';

contract FiatToken is StandardToken,
                      IssuableToken,
                      SeizableToken,
                      ChargeableToken {
  string public name;
  bytes3 public symbol;
  uint public decimals = 2;

  /**
   * @dev called by the owner to construct the FiatToken
   */
  function FiatToken(string _name, bytes3 _symbol) {
    name = _name;
    symbol = _symbol;
    totalSupply = 0;
  }
}
